Biografia_Resumen:
There is more than one artist with this name, including: 
1) Caribou is Canadian Dan Snaith (b. 1978); 
2) Caribou was a French band active in the 1970s; 
3) Caribou is a New Zealand band from Dunedin/Ōtepoti.  

1) Caribou is Canadian Dan Snaith (born Daniel Victor Snaith on 29 March 1978), who formerly recorded under the moniker Manitoba. Known for altering his sound with each subsequent release, he incorporates electronic psychedelia, krautrock rhythms, and breakbeat drums and creates a swirling, lush, musical panorama. <a href="https://www.last.fm/music/Caribou">Read more on Last.fm</a>
